import React from 'react'

const Test3 = () => {
  return (
    <div className='container-fluid' style={{ height : "600px", backgroundImage : "url('/assets/images/1.jpg')"}}>
        <div className='container py-4'>
            <div className='row'>
                <div className='col-md-2 m-1 border border-3 border-dark' style={{ backgroundImage : "url('/assets/images/1.jpg')"}}></div>
                
            </div>
        </div>
    </div>
  )
}

export default Test3
